704cf0dc-c2a7-4ad1-9272-49b6b744790e.description:
Sends error information.

Example: 
{
  "message": "ENOENT: no such file or directory, mkdir '/home/user1/newdir'"
}

inputFunctions.11d18626-aa1d-40c8-9538-bc997b99b974:
const {mkdir} = require("fs");
mkdir(data, (error) => {
  if (error) {
    outputs.bounced(data, tag);
    outputs.error({error: String(error)}, tag);
  } else {
    outputs.created(data, tag);
  }
});
